import React from 'react';
import { createRoute, useLocation } from '@tanstack/react-router';
import { Route } from '../routes/__root';

const ResultsPage = () => {
  // Get search params from URL
  const { search } = useLocation();
  const queryParams = new URLSearchParams(search);
  const data = queryParams.get('data');

  // Parse JSON data
  const parsedData = data ? JSON.parse(data) : null;

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 p-4">
      <h1 className="text-3xl font-bold mb-6 text-gray-800">Results Page</h1>
      <div className="bg-white shadow-md rounded-md p-4 w-full max-w-lg">
        {parsedData ? (
          <pre className="whitespace-pre-wrap text-gray-800">{JSON.stringify(parsedData, null, 2)}</pre>
        ) : (
          <p className="text-gray-600">No data available</p>
        )}
      </div>
    </div>
  );
};

export default ResultsPage;
export const resultsPageRoute = createRoute({
  getParentRoute: () => Route,
  path: "/result",
  component: ResultsPage
});
